('node', 'page', 0, 26, 26, 'und', 0, '<html>\r\n\r\n<?php\r\n\r\n	include ''/myfiles/dbc.php'';\r\n	if(isset($_POST[''submit'']) )\r\n	{\r\n		if(!empty($_POST["pname"]))\r\n		{\r\n			$sql = "select count(platform_id) as cnt from platform where platform_name = ''{$_POST[''pname'']}'' group by platform_id";\r\n			$result = mysqli_query($con,$sql) or die(mysql_error($con));\r\n			$rowcount=mysqli_num_rows($result);\r\n			if($rowcount==0)\r\n			{\r\n			$sql = "insert into platform (platform_name,tags) values (''{$_POST[''pname'']}'',''{$_POST["tags"]}'')";\r\n			$result = mysqli_query($con,$sql) or die(mysql_error($con));\r\n			if($result)\r\n			{echo "<font color=''green'' font=''4''>The platform {$_POST["pname"]} was added successfully.</font>";}	\r\n			}\r\n			else\r\n			{echo "<font color=''red''>Platform already exists, please check and try again.</font>";}\r\n		}	\r\n		else \r\n		{\r\n			echo "<font color=''red''>You need to enter a platform.</font>";\r\n		}\r\n	}\r\n?>\r\n\r\n<br>\r\n<form method="post" action="">\r\n<table border=''1''>\r\n	<col width=''200''>\r\n	<col width=''200''>\r\n	<tr><th>Platform:</th></tr>\r\n	<tr><td><center><input type="text" name="pname"><font color=''red''>*</font></center></td><tr>\r\n    <tr><th>Search Tags:</tr></th>\r\n    <tr><td><center><textarea name="tags" rows="5" cols="40"></textarea>\r\n    <tr><td><center> <input type="submit" name="submit" value="Submit"></center></tr></td>\r\n   	</table>\r\n	</form>\r\n	<font color=''red''>* required field.</font><br><br>\r\n\r\n</form>\r\n</html>', '', 'php_code'),
