INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 3, 3, 'und', 0, '<script src="http://localhost/myfiles/jquery-2.1.4.min.js" type="text/javascript"></script>\r\n<script src="http://localhost/myfiles/my_script.js" type="text/javascript"></script>\r\n<?php\r\n\r\nif(!user_is_logged_in())\r\n{\r\n	echo "<font color=''black'' size=''4''>You won''t be able to use this functionality yet as you have not <a href=''http://localhost/?q=user/register''>Registered</a> for or <a href=''http://localhost/?q=user''>Logged in</a> to an account.</font>";\r\n}\r\nelse\r\n{\r\n	include ''/myfiles/dbc.php'';\r\n	global $user;\r\n\r\n	$sql = "select g.game_title, gg.genre_name, d.developer_name, p.platform_name, ugp.purchase_date, ugp.purchase_price, ugp.satisfaction, s.state, gp.gp_id, ugp.ugp_id, gg.genre_id, p.platform_id\r\n			from game g, developer d, platform p, genre gg, user_game_platform ugp, game_platform gp, state s\r\n			where ugp.gp_id = gp.gp_id and gp.platform_id = p.platform_id and gp.game_id = g.game_id\r\n					and g.developer_id = d.developer_id and gg.genre_id = g.genre_id and s.state_id = ugp.state_id and ugp.user_id = {$user->uid} order by g.game_title";\r\n\r\n	$result = mysqli_query($con, $sql) or die(mysql_error($con));\r\n\r\n	if(mysqli_num_rows($result)==0)\r\n	{\r\n		echo "You don''t have any games in your collection at this time. You can add games to your collection <a href=''http://localhost/?q=add_to_collection''>here.</a>";\r\n	}\r\n	else\r\n	{\r\n		echo "<font color=''black''><table border=''1''>\r\n		<tr>\r\n		<th>Game</th>\r\n		<th>Genre</th>\r\n		<th>Developer</th>\r\n		<th>Platform</th>\r\n		<th>Date</th>\r\n		<th>&#36&#x24</th>\r\n		<th>&#9733</th>\r\n		<th>Condition</th>\r\n		</tr>";\r\n\r\n		while($row = mysqli_fetch_array($result))\r\n		{\r\n			echo "<tr>";\r\n			\r\n			if(strpos($row[0],"Grand Theft Auto")!== FALSE)\r\n			{\r\n				$row[0] = str_replace("Grand Theft Auto","GTA",$row[0]);\r\n			}\r\n			else if(strpos($row[0],"Need For Speed")!== FALSE)\r\n				{\r\n					$row[0] = str_replace("Need For Speed","NFS",$row[0]);\r\n				}\r\n			echo "<td><a href=''http://localhost/?q=game_details&gpid={$row[8]}&ugpid={$row[9]}''>{$row[0]}</a>   <img height=''16'' width=''16'' onclick=''deleteGame(".json_encode($row[9]).");'' src=''/myfiles/images/DeleteRed.png''/></td>";\r\n			\r\n			if(strpos($row[1],"Action-Adventure")!== FALSE)\r\n			{\r\n				$row[1] = str_replace("Action-Adventure","Act-Adv",$row[1]);\r\n			}\r\n			echo "<td><a href=''http://localhost/?q=genre_details&gid={$row[10]}''>{$row[1]}</a></td>";\r\n			\r\n			if(strpos($row[2]," Games")!== FALSE)\r\n			{\r\n				$row[2] = str_replace(" Games","",$row[2]);\r\n			}\r\n			else if(strpos($row[2],"Warner Bros Interactive")!== FALSE)\r\n				{\r\n					$row[2] = str_replace("Warner Bros Interactive","WB",$row[2]);\r\n				}\r\n			else if(strpos($row[2]," Interactive")!== FALSE)\r\n				{\r\n					$row[2] = str_replace(" Interactive","",$row[2]);\r\n				}\r\n			echo "<td>{$row[2]}</td>";\r\n			if(strpos($row[3],"PC Games")!== FALSE)\r\n			{\r\n				$row[3] = str_replace("PC Games","PC",$row[3]);\r\n			}\r\n			echo "<td><a href=''http://localhost/?q=platform_details&pid={$row[11]}''>{$row[3]}</a></td>";\r\n			echo "<td>{$row[4]}</td>";\r\n			echo "<td>{$row[5]}</td>";\r\n			echo "<td>{$row[6]}</td>";\r\n			echo "<td>{$row[7]}</td>";\r\n			echo "</tr>";\r\n		}\r\n		echo "</table></font>";\r\n		\r\n		$sql = "select sum(ugp.purchase_price) as total from user_game_platform ugp where ugp.user_id = {$user->uid}";\r\n		$result = mysqli_query($con, $sql) or die(mysql_error($con));\r\n\r\n		if(mysqli_num_rows($result)!=0)\r\n		{\r\n			foreach($result as $temp)\r\n			{\r\n				echo "<br>\r\n				<font size=''4'' color=''black''>\r\n				<table border=''1''>\r\n				<col width=''200''>\r\n				<col width=''200''>\r\n				<tr>\r\n				<th>Total money spent on your collection is : </th>\r\n				<td>\\${$temp[''total'']}</td>\r\n				</tr>";\r\n			}\r\n		}\r\n		$month = date(''m'');\r\n		$year = date(''Y'');\r\n		$sql = "select sum(p.price) as total from price p, user_game_platform ugp\r\n				where ugp.gp_id = p.gp_id and p.month = {$month} and p.year = {$year} and ugp.user_id = {$user->uid}";\r\n		$result = mysqli_query($con, $sql) or die(mysql_error($con));\r\n\r\n		if(mysqli_num_rows($result)!=0)\r\n		{\r\n			foreach($result as $temp)\r\n			{\r\n				echo "\r\n				<tr>\r\n				<td>Current evaluation of your collection is : </td>\r\n				<th>\\${$temp[''total'']}</th>\r\n				</tr>\r\n				</table>\r\n				</font>";\r\n			}\r\n		}\r\n	}\r\n}\r\n?>', '', 'php_code'),
('node', 'page', 0, 4, 4, 'und', 0, '<font color="black">At Game-On, we help users manage their gaming collection, check the video game price trends, decide if a particular game is worth buying or better to wait for a price drop.<br><br>\r\n<a href="http://localhost/?q=user/register">Register</a> / <a href="http://localhost/?q=user">Login</a> for a new account to get access to a huge database of video games from over a 100 developers, for 7 different gaming platforms.</font>\r\n', '', 'php_code'),
('node', 'page', 0, 5, 5, 'und', 0, '<?php\r\nif(!user_is_logged_in())\r\n{\r\n	echo "<font size=''4'' color=''black''>You won''t be able to use this functionality yet as you have not <a href=''http://localhost/?q=user/register''>Registered</a> for or <a href=''http://localhost/?q=user''>Logged in</a> to an account.<font>";\r\n}\r\nelse\r\n{\r\n	include ''/myfiles/dbc.php'';\r\n	global $user;\r\n?>\r\n\r\n<script src="http://localhost/myfiles/jquery-2.1.4.min.js" type="text/javascript"></script>\r\n<script src="http://localhost/myfiles/my_script.js" type="text/javascript"></script>\r\n<script>\r\n\r\n	$(document).ready(function()\r\n	{\r\n		$("#reset").click (function()\r\n		{\r\n			document.getElementById(''addgameform'').reset();	\r\n			document.getElementById(''satisfactionresult'').value=null;\r\n			document.getElementById(''priceresult'').value=null;\r\n			document.getElementById(''dateresult'').value=null;\r\n			document.getElementById(''result'').value=null;\r\n		});\r\n		\r\n		$("#button").click (function()\r\n		{\r\n			var developer = $(''#developer-list'').val();\r\n			var genre = $(''#genre-list'').val();\r\n			var game = $(''#game-list'').val();\r\n			var platform = $(''#platform-list'').val();\r\n			var purchasedate = $(''#purchasedate'').val();\r\n			var purchaseprice = $(''#purchaseprice'').val();\r\n			var satisfaction = $(''#satisfaction'').val();\r\n			var state = $(''#state-list'').val();\r\n			var user = <?=json_encode($user->uid)?>;\r\n			\r\n			$.ajax({\r\n			type: "POST",\r\n			url: "/myfiles/insert.php",\r\n			data: {developer:developer, genre:genre, game:game, platform:platform, purchasedate:purchasedate, purchaseprice:purchaseprice, satisfaction:satisfaction, state:state, user:user},\r\n			success:function(msg){$(''#result'').html(msg);},\r\n			});\r\n			if(developer==0 && game==0 && genre==0 && platform==0)\r\n			{\r\n				document.getElementById(''addgameform'').reset();\r\n			}		\r\n		});		\r\n	});\r\n\r\n</script>\r\n\r\n<font color=''black'' size=''4''>\r\nLet us start with adding games to your collection. We store a large number of games on our site. So, to narrow the results down for you, lets go step by step.\r\n<br><br>\r\nYou can first select the game developer and then get to your game. Or you can select the game genre first and then get to the desired game.\r\n<br><br>\r\n<form id="addgameform">\r\n	\r\n	<table border=''1''>\r\n	<col width=''200''>\r\n	<col width=''200''>\r\n	<tr>\r\n	<th><center>Step 1 : Select the Game Developer.</center></th>\r\n	<th><center>Step 1 : Select the Game Genre.</center></th>\r\n	</tr>\r\n	<tr>\r\n	<td><center><select name="developer" id="developer-list" onChange="getGameDeveloper(this.value);">\r\n		<option id="0" value="0">Select Developer</option>\r\n		<?php\r\n		$result = mysqli_query($con, "select developer_id, developer_name from developer") or die(mysql_error($con));\r\n		foreach($result as $developer)\r\n		{\r\n			echo "<option value=''{$developer["developer_id"]}''>{$developer["developer_name"]}</option>";\r\n		}\r\n		?>\r\n	</select></center></td>\r\n	\r\n	<td><center><select name="genre" id="genre-list" onChange="getGameGenre(this.value);">\r\n		<option id="0" value="0">Select Genre</option>\r\n		<?php\r\n		$result = mysqli_query($con, "select genre_id, genre_name from genre") or die(mysql_error($con));\r\n		foreach($result as $genre)\r\n		{\r\n			echo "<option value=''{$genre["genre_id"]}''>{$genre["genre_name"]}</option>";\r\n		}\r\n		?>\r\n	</select></center></td>\r\n	</tr>\r\n	</table>\r\n\r\n	<table border=''1''>\r\n	<tr><th><center>Step 2 : Select the Game.</center></th></tr>\r\n	<tr><td><center><select name="game" id="game-list" onChange="getGamePlatform(this.value);">\r\n		<option id="0" value="0">Select Game</option>\r\n	</select></center></td></tr></table>\r\n	\r\n	<table border=''1''>\r\n	<tr><th><center>Step 3 : Select the Game Platform.</center></th></tr>\r\n	<tr><td><center><select name="platform" id="platform-list">\r\n		<option id="0" value="0">Select Platform</option>\r\n	</select></center></td></tr></table>\r\n	\r\n	<table border=''1''>\r\n	<tr><th><center>Step 4 : Select the Game Purchase Date.</center></th></tr>\r\n	<tr><td><center><input type="date" name="purchasedate" id="purchasedate" onChange="getGameReleaseDate(this.value)";>\r\n	<div id="dateresult"></div>\r\n	</center></input></td></tr></table>\r\n	\r\n	<table border=''1''>\r\n	<tr><th><center>Step 5 : Select the Game Purchase Price.</center></th></tr>\r\n	<tr><td><center>We''ll round it off to a price which has 2 digits after the decimal.<br>\r\n	$ <input type="text" name="purchaseprice" id="purchaseprice" onChange="getGamePrice(this.value)";>\r\n	<div id="priceresult"></div>\r\n	</center></input></td></tr></table>\r\n	\r\n	<table border=''1''>\r\n	<tr><th><center>Step 6 : Select the Game Satisfaction.</center></th></tr>\r\n	<tr><td><center>On a scale of 1 to 10. If you don''t change the slider below, 5 would be the default rating.<br>\r\n	<input type="range" name="satisfaction" id="satisfaction" min="1" max="10" value="5" onChange="getGameSatisfaction(this.value)";><br>\r\n	<div id="satisfactionresult"></div>\r\n	</center></input></td></tr></table>\r\n	\r\n	<table border=''1''>\r\n	<tr><th><center>Step 7 : Select the Condition of the Game.</center></th></tr>\r\n	<tr><td><center><select name="state" id="state-list">\r\n		<option id="0" value="0">Select Condition</option>\r\n		<?php\r\n		$result = mysqli_query($con, "select state_id, state from state") or die(mysql_error($con));\r\n		foreach($result as $state)\r\n		{\r\n			echo "<option value=''{$state["state_id"]}''>{$state["state"]}</option>";\r\n		}\r\n		?>\r\n	</select></center></td></tr></table></font>\r\n\r\n	<center><input type="button" id="button" value="Add" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<input type="reset" id="reset" value="Reset" /><br><br>\r\n	<div id="result"></div></center>\r\n	\r\n</form>\r\n<?php\r\n}\r\n?>', '', 'php_code'),
('node', 'page', 0, 7, 7, 'und', 0, '<?php\r\n\r\ninclude ''/myfiles/dbc.php'';\r\ninclude ''/myfiles/simple_html_dom.php'';\r\n\r\n$sql = "select g.game_title, p.platform_name, gp.gp_id\r\n		from game g, platform p, game_platform gp\r\n		where gp.game_id = g.game_id and p.platform_id = gp.platform_id";\r\n\r\n$result = mysqli_query($con, $sql) or die(mysqli_error($con));\r\n\r\nforeach($result as $temp)\r\n{\r\n	$url = ''http://videogames.pricecharting.com/game/''.str_replace(" ","-",$temp[''platform_name'']).''/''.str_replace(" ","-",$temp[''game_title'']);\r\n	echo $url."<br>";\r\n	$html = file_get_html($url);\r\n	$price_array = $html->find(''#new_price'');\r\n	\r\n	if(!empty($price_array))\r\n	{\r\n		preg_match_all(''!\\d+!'', $price_array[0], $matches);\r\n		$price = (float)$matches[0][0]+(float)$matches[0][1]/100;\r\n		$sql = "insert into price (gp_id,month,year,price) values({$temp[''gp_id'']},".date(''m'').",".date(''Y'').",{$price})";\r\n		mysqli_query($con, $sql) or die(mysqli_error($con));\r\n	}\r\n	else\r\n	{\r\n		$sql = "insert into price (gp_id,month,year,price) values({$temp[''gp_id'']},".date(''m'').",".date(''Y'').",9.99)";\r\n		mysqli_query($con, $sql) or die(mysqli_error($con));\r\n	}\r\n}\r\n?>', '', 'php_code'),
('node', 'page', 0, 8, 8, 'und', 0, '<?php\r\n\r\nif(empty($_GET[''gpid'']))\r\n{\r\n	echo "This is empty.";\r\n}\r\nelse if(isset($_GET[''gpid'']))\r\n{\r\n	include ''/myfiles/dbc.php'';\r\n	include ''/myfiles/functions.php'';\r\n	global $user;\r\n\r\n	$sql = "select g.game_id, g.game_title, gg.genre_id, gg.genre_name, d.developer_name, p.platform_id, p.platform_name, gp.release_date, gp.price\r\n			from game g, developer d, genre gg, platform p, game_platform gp\r\n			where g.developer_id = d.developer_id and g.genre_id = gg.genre_id and gp.game_id = g.game_id and\r\n			gp.platform_id = p.platform_id and gp.gp_id = {$_GET[''gpid'']}";\r\n\r\n	$result = mysqli_query($con, $sql) or die(mysql_error($con));\r\n	\r\n	if(mysqli_num_rows($result)!=0)\r\n	{\r\n		foreach($result as $temp)\r\n		{			\r\n			echo "<table border = ''1''>\r\n			<tr>\r\n				<th height=''260'' width=''260''>\r\n				<img src=''/myfiles/images/games/{$temp[''game_id'']}.jpg''/>\r\n				</th>\r\n				<th valign=''top''><font size = ''4.5''>\r\n					Game : <br>\r\n					Genre : <br>\r\n					Developer : <br>\r\n					Platform : <br>\r\n					Release Date : <br>\r\n					Release Price : <br>";\r\n			if(user_is_logged_in() && isset($_GET[''ugpid'']))\r\n			{\r\n				echo"\r\n					Purchase Date : <br>\r\n					Purchase Price : <br>\r\n					Your Rating : <br>\r\n					Condition : <br>";\r\n			}\r\n					\r\n			echo"\r\n				</font></th>\r\n				<td><font size = ''4.5'' color=''black''>\r\n					{$temp[''game_title'']}<br>\r\n					<a href=''http://localhost/?q=genre_details&gid={$temp[''genre_id'']}''>{$temp[''genre_name'']}</a><br>\r\n					{$temp[''developer_name'']}<br>\r\n					<a href=''http://localhost/?q=platform_details&pid={$temp[''platform_id'']}''>{$temp[''platform_name'']}</a><br>\r\n					{$temp[''release_date'']}<br>\r\n					\\${$temp[''price'']}<br>";\r\n			if(user_is_logged_in() && isset($_GET[''ugpid'']))\r\n			{\r\n				$sql = "select ugp.purchase_date, ugp.purchase_price, ugp.satisfaction, s.state\r\n				