('node', 'page', 0, 17, 17, 'und', 0, '<?php\r\n\r\nif(empty($_GET[''pid'']))\r\n{\r\n	echo "This is empty.";\r\n}\r\nelse if(isset($_GET[''pid'']))\r\n{\r\n	include ''/myfiles/dbc.php'';\r\n	include ''/myfiles/functions.php'';\r\n	global $user;\r\n\r\n	$sql = "select platform_id, platform_name from platform where platform_id = {$_GET[''pid'']}";\r\n\r\n	$result = mysqli_query($con, $sql) or die(mysql_error($con));\r\n	\r\n	if(mysqli_num_rows($result)!=0)\r\n	{\r\n		foreach($result as $temp)\r\n		{			\r\n			echo "<table border = ''1''>\r\n			<tr>\r\n				<th height=''260'' width=''260''>\r\n				<img src=''/myfiles/images/platforms/{$temp[''platform_id'']}.jpg''/>\r\n				</th>\r\n				<th valign=''top''><font size = ''4.5''>\r\n					Platform : <br>";\r\n			\r\n			if(user_is_logged_in())\r\n			{\r\n				echo "No. of {$temp[''platform_name'']} games you own : <br>";\r\n				$sql_2 = "select p.platform_id as counter, p.platform_name from user_game_platform ugp, game_platform gp, game g, genre ge, platform p, developer d \r\n							where ugp.gp_id=gp.gp_id and gp.game_id=g.game_id and gp.platform_id=p.platform_id and g.genre_id=ge.genre_id and g.developer_id=d.developer_id \r\n							and user_id={$user->uid} and p.platform_id={$_GET[''pid'']}";\r\n				$result_2 = mysqli_query($con, $sql_2) or die(mysql_error($con));\r\n				$rowcount = mysqli_num_rows($result_2);\r\n			}\r\n			\r\n			echo"\r\n				</font></th>\r\n				<td><font size = ''4.5''>\r\n					{$temp[''platform_name'']}<br>";\r\n					\r\n			if(user_is_logged_in())\r\n			{\r\n				echo "{$rowcount}<br>";\r\n			}\r\n			\r\n			echo"</font></td>\r\n				</tr></table>";\r\n		}\r\n	}\r\n	else\r\n	{\r\n		echo "<font color=''red''>There was some error.</font>";	\r\n	}\r\n?>\r\n	<hr><hr>\r\n	\r\n<?php\r\n\r\n	$sql = "select sum(pp.price) as total, pp.month, pp.year, p.platform_name from platform p, price pp, game_platform gp\r\n			where gp.platform_id = p.platform_id and pp.gp_id = gp.gp_id and p.platform_id = {$_GET[''pid'']}\r\n			group by p.platform_name, pp.month, pp.year order by p.platform_name asc, pp.year desc, pp.month desc limit 12";\r\n	$result = mysqli_query($con, $sql) or die(mysql_error($con));\r\n?>\r\n\r\n<html>\r\n    <head>\r\n	<style>\r\n		div.box{\r\n			border: 3px solid #33cc99;\r\n		}\r\n	</style>\r\n        <script type="text/javascript" src="http://www.google.com/jsapi"></script>\r\n        <script type="text/javascript">\r\n            google.load(''visualization'', ''1'', {''packages'': [''corechart'']});\r\n            google.setOnLoadCallback (createChart);\r\n \r\n            function createChart() {\r\n                var dataTable = new google.visualization.DataTable();\r\n \r\n                dataTable.addColumn(''string'',''Year 2015'');\r\n                dataTable.addColumn(''number'', ''Price'');\r\n \r\n                dataTable.addRows([\r\n				\r\n				<?php\r\n				\r\n				if(mysqli_num_rows($result)!=0)\r\n				{\r\n					$i=12; $pname = '''';\r\n					$month_name = [''Jan'',''Feb'',''Mar'',''Apr'',''May'',''Jun'',''Jul'',''Aug'',''Sep'',''Oct'',''Nov'',''Dec''];\r\n					$month = array();\r\n					$year = array();\r\n					$total = array();\r\n					foreach($result as $temp)\r\n					{\r\n						$month[] = $temp[''month'']-1;\r\n						$year[] = $temp[''year''];\r\n						$total[] = $temp[''total''];\r\n						$pname = $temp[''platform_name''];\r\n					}\r\n				}\r\n				for($i=11;$i>-1;$i--)\r\n				{\r\n					if($i==0)\r\n					{\r\n						echo "[''".$month_name[$month[$i]]." ".$year[$i]."'',".$total[$i]."]";\r\n					}\r\n					else\r\n					{\r\n						echo "[''".$month_name[$month[$i]]." ".$year[$i]."'',".$total[$i]."],";\r\n					}\r\n				}\r\n				?>\r\n                ]);\r\n				\r\n				var chart = new google.visualization.ColumnChart (document.getElementById(''chart1''));\r\n \r\n                var options = {width: 780, height: 420, is3D: true,bar: {groupWidth: "65%"}, title: ''<?php echo $pname;?> Trend''};\r\n \r\n                chart.draw(dataTable, options);\r\n			}\r\n        </script>\r\n	</head>\r\n<body>\r\n        <div id="chart1" class="box"></div>\r\n</body>\r\n</html>\r\n<?php\r\n\r\n	$sql = "select platform_id, platform_name from platform where platform_id = {$_GET[''pid'']}";\r\n	$result = mysqli_query($con, $sql) or die(mysql_error($con));\r\n	foreach($result as $platform)\r\n	{\r\n		$platform_name = $platform[''platform_name''];\r\n		$platform_id = $platform[''platform_id''];\r\n	}\r\n	\r\n	$sql = "select sum(pp.price) as total, pp.month, pp.year, p.platform_name from platform p, price pp, game_platform gp\r\n			where gp.platform_id = p.platform_id and pp.gp_id = gp.gp_id and p.platform_name = ''{$platform_name}''\r\n			group by p.platform_name, pp.month, pp.year order by p.platform_name asc, pp.year desc, pp.month desc limit 12";\r\n	$result = mysqli_query($con, $sql) or die(mysql_error($con));\r\n\r\n	if(mysqli_num_rows($result)!=0)\r\n	{\r\n		$price_array = array();\r\n		foreach($result as $temp)\r\n		{\r\n			$price_array[] = $temp[''total''];\r\n		}\r\n		$sum=0; $j=0; $avg=array();\r\n		for ($i=11; $i>=0; $i--)\r\n		{\r\n			$sum = $sum + $price_array[$i];\r\n			$j++;\r\n			$avg[] = round(($sum/$j),2);\r\n		}\r\n	}\r\n	\r\n	$platform_trend_score = trend_score(pg_trend(0,11,$avg), pg_trend(0,4,$avg), pg_trend(5,11,$avg), pg_trend(5,8,$avg), pg_trend(8,11,$avg));\r\n?>\r\n	<font color=''black'' size=''4''>\r\n	<table border=''1''>\r\n	<col width=''200''>\r\n	<col width=''200''>\r\n	<tr>\r\n		<th><center><?php echo "<font color=''yellow''>{$platform_name}</font></a>''s";?> Trend Score is : </center></th>\r\n		<td><center><?php echo "<font color=''black''>{$platform_trend_score}</font>"; ?></center></td>\r\n	</tr>\r\n	</table>\r\n	</font>\r\n\r\n\r\n<?php\r\n\r\n}\r\n\r\n?>', '', 'php_code'),
