      </script>\r\n	</head>\r\n<body>\r\n        <div id="chart1" class="box"></div>\r\n</body>\r\n</html>\r\n\r\n<?php\r\n\r\n	$sql = "select genre_id, genre_name from genre where genre_id = {$_GET[''gid'']}";\r\n	$result = mysqli_query($con, $sql) or die(mysql_error($con));\r\n	foreach($result as $genre)\r\n	{\r\n		$genre_name = $genre[''genre_name''];\r\n		$genre_id = $genre[''genre_id''];\r\n	}\r\n	\r\n	$sql = "select sum(pp.price) as total, pp.month, pp.year, gg.genre_name from genre gg, price pp, game_platform gp, game g\r\n			where g.genre_id = gg.genre_id and g.game_id = gp.game_id and pp.gp_id = gp.gp_id and gg.genre_name = ''{$genre_name}''\r\n			group by gg.genre_name, pp.month, pp.year order by gg.genre_name asc, pp.year desc, pp.month desc limit 12";\r\n	$result = mysqli_query($con, $sql) or die(mysql_error($con));\r\n\r\n	if(mysqli_num_rows($result)!=0)\r\n	{\r\n		$price_array = array();\r\n		foreach($result as $temp)\r\n		{\r\n			$price_array[] = $temp[''total''];\r\n		}\r\n		$sum=0; $j=0; $avg=array();\r\n		for ($i=11; $i>=0; $i--)\r\n		{\r\n			$sum = $sum + $price_array[$i];\r\n			$j++;\r\n			$avg[] = round(($sum/$j),2);\r\n		}\r\n	}\r\n\r\n	$genre_trend_score = trend_score(pg_trend(0,11,$avg), pg_trend(0,4,$avg), pg_trend(5,11,$avg), pg_trend(5,8,$avg), pg_trend(8,11,$avg));\r\n?>\r\n	<font color=''black'' size=''4''>\r\n	<table border=''1''>\r\n	<col width=''200''>\r\n	<col width=''200''>\r\n	<tr>\r\n		<th><center><?php echo "<font color=''yellow''>{$genre_name}</font></a>''s";?> Trend Score is : </center></th>\r\n		<td><center><?php echo "<font color=''black''>{$genre_trend_score}</font>"; ?></center></td>\r\n	</tr>\r\n	</table>\r\n	</font>\r\n\r\n<?php\r\n\r\n}\r\n\r\n?>', '', 'php_code');
INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
