NULL,''{$row[''release_date'']}'',{$row[''price'']},{$row[''gp_id'']})";\r\n			$result_2 = mysqli_query($con,$sql_2) or die(mysql_error($con));\r\n		}\r\n		if(is_null($row[''release_date'']))\r\n		{\r\n			$game_title = get_game_title($row[''game_id'']);\r\n			$platform_name = get_platform_name($row[''platform_id'']);\r\n			$sql_2 = "insert into null_predict(game_title, genre_name, developer_name, platform_name, release_date, price, gp_id) values (''{$game_title}'','''','''',''{$platform_name}'',NULL,{$row[''price'']},{$row[''gp_id'']})";\r\n			$result_2 = mysqli_query($con,$sql_2) or die(mysql_error($con));\r\n		}\r\n		if(is_null($row[''price'']))\r\n		{\r\n			$game_title = get_game_title($row[''game_id'']);\r\n			$platform_name = get_platform_name($row[''platform_id'']);\r\n			$sql_2 = "insert into null_predict(game_title, genre_name, developer_name, platform_name, release_date, price, gp_id) values (''{$game_title}'','''','''',''{$platform_name}'',''{$row[''release_date'']}'',NULL,{$row[''gp_id'']})";\r\n			$result_2 = mysqli_query($con,$sql_2) or die(mysql_error($con));\r\n		}\r\n	}\r\n\r\n	$sql = "select np_id, gp_id, game_id, game_title, genre_name, developer_name, platform_name, release_date, price from null_predict";\r\n	$result = mysqli_query($con,$sql) or die(mysql_error($con));\r\n	foreach($result as $row)\r\n	{\r\n		if(is_null($row[''genre_name'']))\r\n		{\r\n			$developer_genre_confidence = developer_genre_confidence($row[''developer_name'']);\r\n			$developer_genre_confidence[0] = $developer_genre_confidence[0]*100;\r\n			\r\n			$sql_2 = "update null_predict set genre_name = ''{$developer_genre_confidence[1]}'' where np_id = {$row[''np_id'']}";\r\n			$result_2 = mysqli_query($con,$sql_2) or die(mysql_error($con));\r\n		}\r\n		else if(is_null($row[''developer_name'']))\r\n		{\r\n			$genre_developer_confidence = genre_developer_confidence($row[''genre_name'']);\r\n			$genre_developer_confidence[0] = $genre_developer_confidence[0]*100;\r\n			\r\n			$sql_2 