('node', 'page', 0, 24, 24, 'und', 0, '<font size=''4'' color=''black''>As an administrator you have an option to add games, developers, genres and platforms. If you are ready with the details, go ahead and try them out.<br><br>\r\n<table border=''1''>\r\n<tr><th><center>Add Games</center></th></tr>\r\n<tr><td><center><a href=''http://localhost/?q=add_game''>Click here to add a game</a></center></td></tr>\r\n<tr><th><center>Add Developers</center></th></tr>\r\n<tr><td><center><a href=''http://localhost/?q=add_developer''>Click here to add a developer</a></center></td></tr>\r\n<tr><th><center>Add Genres</center></th></tr>\r\n<tr><td><center><a href=''http://localhost/?q=add_genre''>Click here to add a genre</a></center></td></tr>\r\n<tr><th><center>Add Platforms</center></th></tr>\r\n<tr><td><center><a href=''http://localhost/?q=add_platform''>Click here to add a platform</a></center></td></tr>\r\n</table>\r\n</font>', '', 'php_code'),
